import Hamburger from 'hamburger-react';
import { useState } from 'react';
import {Link , } from 'react-router-dom';
import Theme from './theme';
import '../stylesheet/compsStyle/navbar.css';
export default function Navbar () {

    const [isOpen, setOpen] = useState(false)



    return (
        <>
        <header className='navbar'>
            <div className='navbar_logo'>UniverTools</div>
<Hamburger  color="white" size="25" toggled={isOpen} toggle={setOpen} />
            <nav className='navbar_li'>
                <ul>
                    <li>
                       <Link activeClassName="active" to={'/'}>جميع الخدمات</Link>
                    </li>
                    <li>
                       <Link activeClassName="active" to={'/balanced'}>حساب الموزونة</Link>
                    </li>
                    <li>
                       <Link activeStyle="active" to={'/age'}>حساب العمر</Link>
                    </li>
                    <li>
                  <a>
                  <Theme/>
                  </a>
                    </li>
                </ul>
            </nav>
        </header>
        </>
    )
};
